import axios from "axios";
import React, { useState, useEffect } from "react";
import "./AdminOrder.css";
function AdminOrder() {
	const [OrderList, SetOrderList] = useState([]);

	useEffect(() => {
		axios.post("http://localhost:3001/api/GetOrders").then((response) => {
			SetOrderList(response.data);
			console.log(response.data);
			console.log(response.data.SelectedOptions);
		});
	}, []);
	return (
		<div className="AdminOrder">
			<table>
				<tbody>
					<tr>
						<th>1</th>
						<th>2</th>
						<th>3</th>
						<th>4</th>
						<th>5</th>
						<th>6</th>
					</tr>
					{OrderList.map((info, index) => {
						return (
							<tr className="QAdminOrderItem" key={index}>
								<td> {info.id}</td>
								<td> {info.name}</td>
								<td> {info.price}</td>
								<td> {info.SelectedOptions}</td>
								<td> {info.customTextArray}</td>
							</tr>
						);
					})}
					<tr>
						<td>16</td>
						<td>14</td>
						<td>10</td>
					</tr>
				</tbody>
			</table>
		</div>
	);
}

export default AdminOrder;
